description:
Director: Eytan Fox

Writer: Itay Segal

Stars: Ohad Knoller, Oz Zehavi and Lior Ashkenazi

Plot: Yossi is a cardiologist who never overcame the death of Jagger, his great love. Although sought after, he lives alone and tries to dissipate his melancholy in excessive work. One day a mysterious woman enters his practice. This encounter changes his life course and he decides to leave Tel Aviv. In Eilat, in Southern Israel, Yossi meets a group of Israeli soldiers who open up a world of possibilities for Yossi. Sequel to Yossi &amp; Jagger (2002).

